/**
 * Get station information by WMO index
 */
export const getStationInfo = (wmoIndex: string): StationInfo | null => {
  return STATION_NAMES[wmoIndex] || null;
};

/**
 * Decode SYNOP temperature from group 1SnTTT
 * Temperature is in tenths of degrees Celsius
 * @param group - SYNOP group like "11008" where 1 is sign, 100.8 is temperature
 */
const decodeTemperature = (group: string): number | undefined => {
  if (group.length !== 5 || group[0] !== '1') return undefined;
  
  const sign = group[1] === '0' ? 1 : -1;
  const tempValue = parseInt(group.substring(2), 10);
  
  if (isNaN(tempValue)) return undefined;
  
  return sign * (tempValue / 10);
};

/**
 * Decode SYNOP precipitation from group 6RRRt
 * Precipitation amount in mm
 */
const decodePrecipitation = (group: string): number | undefined => {
  if (group.length < 5 || group[0] !== '6') return undefined;
  
  const precip = parseInt(group.substring(1, 4), 10);
  
  if (isNaN(precip)) return undefined;
  
  // 000 means no precipitation or trace
  if (precip === 0) return 0;
  
  // Values 990-999 have special meanings
  if (precip >= 990) {
    // 990 = 0.0 mm, 991 = 0.1 mm, etc.
    return (precip - 990) / 10;
  }
  
  return precip;
};

/**
 * Parse a SYNOP message and extract weather data
 */
const parseSynopMessage = (wmoIndex: string, year: number, month: number, day: number, hour: number, minute: number, synopCode: string): SynopObservation => {
  const timestamp = new Date(Date.UTC(year, month - 1, day, hour, minute));
  
  const observation: SynopObservation = {
    timestamp,
    wmoIndex,
    synopCode,
  };
  
  // Split SYNOP code into groups
  const groups = synopCode.split(/\s+/);
  
  // Find temperature (group starting with 1)
  for (const group of groups) {
    if (group.startsWith('1') && group.length === 5) {
      const temp = decodeTemperature(group);
      if (temp !== undefined) {
        observation.temperature = temp;
      }
    }
    
    // Find precipitation (group starting with 6)
    if (group.startsWith('6') && group.length >= 5) {
      const precip = decodePrecipitation(group);
      if (precip !== undefined) {
        observation.precipitation = precip;
      }
    }
  }
  
  return observation;
};

/**
 * Format date for Ogimet display_synops2.php API
 * Returns separate components for year, month, day, hour
 */
const formatOgimetDateComponents = (date: Date): { year: number; month: number; day: number; hour: number } => {
  return {
    year: date.getUTCFullYear(),
    month: date.getUTCMonth() + 1,
    day: date.getUTCDate(),
    hour: date.getUTCHours()
  };
};

/**
 * Fetch SYNOP observations from Ogimet using display_synops2.php
 * @param wmoIndex - WMO station index (e.g., "01245" for Oppdal-Bjorke)
 * @param startDate - Start date for observations
 * @param endDate - End date for observations
 */
export const getSynopObservations = async (
  wmoIndex: string,
  startDate: Date,
  endDate: Date
): Promise<SynopObservation[]> => {
  const start = formatOgimetDateComponents(startDate);
  const end = formatOgimetDateComponents(endDate);
  
  // Build URL using display_synops2.php endpoint as per user request
  const params = new URLSearchParams({
    lang: 'en',
    lugar: wmoIndex,
    tipo: 'ALL',
    ord: 'REV',
    nil: 'NO',
    fmt: 'html',
    ano: String(start.year),
    mes: String(start.month).padStart(2, '0'),
    day: String(start.day).padStart(2, '0'),
    hora: String(start.hour).padStart(2, '0'),
    anof: String(end.year),
    mesf: String(end.month).padStart(2, '0'),
    dayf: String(end.day).padStart(2, '0'),
    horaf: String(end.hour).padStart(2, '0'),
    send: 'send'
  });
  const ogimetUrl = `https://www.ogimet.com/display_synops2.php?${params.toString()}`;
  const url = `${CORS_PROXY}${encodeURIComponent(ogimetUrl)}`;
  
  const response = await fetch(url);
  if (!response.ok) {
    throw new Error(`Failed to fetch SYNOP data: ${response.statusText}`);
  }
  
  const html = await response.text();
  
  // Parse HTML to extract SYNOP messages
  const observations: SynopObservation[] = [];
  
  // Extract SYNOP codes from HTML - they appear in <pre> tags after AAXX headers
  // Format: AAXX YYGGi followed by SYNOP data in the next <pre> tag
  const preTagPattern = /<pre>(AAXX \d{5}|[\d\s/=]+)<\/pre>/gi;
  const matches = html.match(preTagPattern);
  
  if (!matches) {
    return observations;
  }
  
  let currentHeader: string | null = null;
  
  for (const match of matches) {
    const content = match.replace(/<\/?pre>/g, '').trim();
    
    if (content.startsWith('AAXX')) {
      // This is a header with timestamp
      currentHeader = content;
    } else if (currentHeader && content) {
      // This is SYNOP data following a header
      try {
        // Parse the AAXX header: AAXX YYGGi
        const headerParts = currentHeader.split(/\s+/);
        if (headerParts.length >= 2) {
          const timeCode = headerParts[1];
          const day = parseInt(timeCode.substring(0, 2), 10);
          const hour = parseInt(timeCode.substring(2, 4), 10);
          
          // Determine year and month based on date range
          // Strategy: Find the date within the range that matches this day and hour
          let bestDate = new Date(start.year, start.month - 1, day, hour);
          
          // If this date is before our start date, try next month
          if (bestDate < startDate) {
            bestDate = new Date(start.year, start.month, day, hour);
            // If still before start, try next month again (for year boundary)
            if (bestDate < startDate && start.month === 12) {
              bestDate = new Date(start.year + 1, 0, day, hour);
            }
          }
          
          // Only include if within our date range
          if (bestDate >= startDate && bestDate <= endDate) {
            const synopCode = content;
            const observation = parseSynopMessage(
              wmoIndex, 
              bestDate.getFullYear(), 
              bestDate.getMonth() + 1, 
              day, 
              hour, 
              0, 
              synopCode
            );
            observations.push(observation);
          }
        }
      } catch (error) {
        console.error('Error parsing SYNOP message:', error);
      }
      
      currentHeader = null;
    }
  }
  
  return observations;
};

/**
 * Get list of available WMO stations
 */
export const getAvailableStations = (): StationInfo[] => {
  return Object.values(STATION_NAMES);
};
